			shellScript = "echo \"DES build: checking your dependencies!\"\n\nif [ -z ${XCODE_VERSION_ACTUAL+x} ]; then\n    echo \"error: Xcode not present\"\n    exit 1\nfi\nPATH=/usr/local/bin:$PATH\nNPROC=\"$(sysctl -n hw.ncpu)\"\nWORKSPACE=\"$PROJECT_DIR/_support/_work\"\n\nmake_libsodium() {\n    echo \"Need to build libsodium. This will take a while.\"\n    mkdir -p \"$WORKSPACE\" && cd \"$WORKSPACE\"\n    rm -rf libsodium\n    git clone \"https://github.com/jedisct1/libsodium\" libsodium && cd libsodium\n    ./autogen.sh > /dev/null 2>&1\n    ./configure \"--prefix=$PROJECT_DIR/_support\" \\\n    > \"$WORKSPACE/../libsodium.configure.log\" 2>&1\n    make -j$NPROC \\\n    > \"$WORKSPACE/../libsodium.make.log\" 2>&1 && make install\n    echo \"OK.\"\n    rm -f \"$WORKSPACE/../libsodium.configure.log\" \"$WORKSPACE/../libsodium.make.log\"\n}\nmake_djbdns() {\n    echo \"Need to build djbdns. This will take almost no time at all.\"\n    mkdir -p \"$WORKSPACE\" && cd \"$WORKSPACE\"\n    rm -rf \"djbdns-1.05\"\n    curl -o djbdns.tar.gz \"http://cr.yp.to/djbdns/djbdns-1.05.tar.gz\"\n    tar -xzf \"djbdns.tar.gz\" && cd \"djbdns-1.05\"\n    make -j$NPROC\n    cp *.a \"$WORKSPACE/../lib/\"\n    cp *.h \"$WORKSPACE/../include/\"\n    sed -i .orig -e \"s/#include \\\"uint64.h\\\"//\" \"$WORKSPACE/../include/tai.h\"\n    cp iopause.o \"$WORKSPACE/../lib/\"\n    echo \"OK.\"\n}\nif [ ! -f \"$PROJECT_DIR/_support/lib/libsodium.a\" ]; then\n    make_libsodium\nfi\nif [ ! -f \"$PROJECT_DIR/_support/lib/dns.a\" ]; then\n    make_djbdns\nfi";
		};
